## Solution

To solve this problem, I will use React Context to create a global state for the Tooltip component. This will allow me to keep track of the currently open Tooltip and close it when a new one is opened.

First, let's create a new file called `TooltipContext.js`:

```jsx
import React, { createContext, useState } from 'react';

export const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [openTooltip, setOpenTooltip] = useState(null);

  const closeTooltip = () => {
    setOpenTooltip(null);
  };

  const openTooltipHandler = (id) => {
    if (openTooltip === id) {
      closeTooltip();
    } else {
      setOpenTooltip(id);
      closeTooltip();
    }
  };

  return (
    <TooltipContext.Provider value={{ openTooltipHandler, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};
```

In this file, we create a new context called `TooltipContext` and a provider component called `TooltipProvider`. The provider component has a state called `openTooltip` that keeps track of the currently open Tooltip. We also have two functions: `closeTooltip` and `openTooltipHandler`.

The `closeTooltip` function sets the `openTooltip` state to `null`, which closes the currently open Tooltip. The `openTooltipHandler` function takes an `id` as a parameter and opens the Tooltip with the corresponding `id`. If the Tooltip with the given `id` is already open, it closes it.

Now, let's create the Tooltip component itself:

```jsx
import React, { useContext } from 'react';
import { TooltipContext } from './TooltipContext';

const Tooltip = ({ id, children, content }) => {
  const { openTooltipHandler, closeTooltip } = useContext(TooltipContext);

  const handleMouseEnter = () => {
    openTooltipHandler(id);
  };

  const handleMouseLeave = () => {
    closeTooltip();
